import { useState, useEffect } from "react";
import { Navbar } from "react-bootstrap";

import background from "./images/jmeet-background.jpg";
// import logo from "./logo.svg";
// import "./App.css";

const App = () => {
  const [placeholder, setPlaceholder] = useState("Hi");

  useEffect(() => {
    fetch("/hello")
      .then((res) => res.json())
      .then((data) => {
        console.log("data", data);
        setPlaceholder(data);
        // setPlaceholder(data.result);
      });
  }, []);

  return (
    <div className="main">
      <div>
        <Navbar className="colorNav">
          <Navbar.Brand href="#home">Home</Navbar.Brand>
          <Navbar.Brand href="#about-us">About Us</Navbar.Brand>
          <Navbar.Brand href="#vision">Our Vision</Navbar.Brand>
          <Navbar.Brand href="#login">Login</Navbar.Brand>
        </Navbar>
      </div>
      <div>
        <p className="content">Flask says {placeholder}</p>
      </div>
    </div>
  );
};

export default App;
